import Vue from 'vue'
import VueRouter from 'vue-router'
import VueDataTable from '@/components/VueDataTable'
import DemandeDataTable from '@/components/DemandeDataTable'
Vue.use(VueRouter)

const routes = [
  {
    path: '/test',
    name: 'VueDataTable',
    component: VueDataTable
  },
  {
    path: '/demande',
    name: 'DemandeDataTable',
    component: DemandeDataTable
  },
  
]

const router = new VueRouter({
  mode: 'history',
  base: process.env.BASE_URL,
  routes
})

export default router
